// Helper functions
func getStatusColorClass(status string) string {
	switch status {
	case "success":
		return "bg-success-light"
	case "error":
		return "bg-danger-light"
	case "pending":
		return "bg-info-light"
	default:
		return "bg-warning-light"
	}
}

func getStatusBadgeClass(status string) string {
	switch status {
	case "success":
		return "bg-success"
	case "error":
		return "bg-danger"
	case "pending":
		return "bg-info"
	default:
		return "bg-warning"
	}
}

func getUint64Value(v interface{}) uint64 {
	switch val := v.(type) {
	case uint64:
		return val
	case int64:
		return uint64(val)
	case int:
		return uint64(val)
	case float64:
		return uint64(val)
	default:
		return 0
	}
}

